import './Skeleton.scss'

const Skeleton:React.FC = () => {
    return (

        <section className="userList">
      <div className="profile-img" />
      <div className="skeleton-placeholder" />
      <div className="skeleton-placeholder" />
    </section>

    );
};

export default Skeleton;
